import React from 'react';
import './Card.css';

const MenteeCard = ({ name, progress }) => {
  return (
    <div className="card mentee-card">
      <h3>{name}</h3>
      <p>Progress: {progress}</p>
    </div>
  );
};

export default MenteeCard;
